```
![image](https://user-images.githubusercontent.com/54979375/160158394-f06030df-a061-44a7-aa5b-adff6ec14d59.png)
```javascript 

var web3 = new Web3(erigon)
var web32 = new Web3(geth)
var colors = require('colors');
web3.eth.subscribe('newBlockHeaders', (error, sync) => {
    if (error) console.log(error);
}).on("data", async (sync) => {
    var latest= await web3.eth.getBlock("latest")
    console.log(`${Date.now()} erigon ${latest.number}`.green)
});

web32.eth.subscribe('newBlockHeaders', (error, sync) => {
   if (error) console.log(error);
}).on("data", async (sync) => {
    var latest= await web32.eth.getBlock("latest")
    console.log(`${Date.now()} geth ${latest.number}`.red)
});
```
